import React from 'react';
import './home.css';

function Home() {

    let currTime = new Date().toLocaleTimeString();

    let greeting = "";
    let cssTime = {};

    return(
        <>
        <div className='time'>
        <h1>Hello Buddy, <span style={cssTime}>{greeting}</span> </h1>
        <h2>{currTime}</h2>
        </div>          
        </>
    )
}

export default Home;
